import React from 'react'

export const Count = () => {
  return (
    <div>
        <h1>Count</h1>
        <p>This is the Count component</p>

        <h1>{num}</h1>
        <button onClick={plus}>+</button> &nbsp;
        <button onClick={sub}>-</button> &nbsp;
        <button onClick={reset}>reset</button> <br /><br />
    </div>
  )
}
